function pugRender(str) {
    let html = str.split('\n');
    //Encontrar la primera linea no vacia
    let index;
    for(index = 0, line = ""; index < html.length; index++) {
        line = html[index].valueOf().replace(/[\r\n\t\s]/g, "");
        if(line.length > 0)
            break;
    }
    //Eliminar las lineas vacias
    html = html.splice(index);
    //Hallar el numero de whitespaces y tabs detras del primer caracter de la primera linea (que ya no es vacia)
    leftSide = html[0].match(/^\s*/)[0].length;
    //
    html.forEach((value, index, array) => {
        array[index] = value.slice(leftSide, value.length);
    });
    html = html.join('\n');
    
    return pug.render(html);
}

//Solo eliminar los newlines del texto scss
function lessRender(str) {
    let renderSync = Promise.method(less.render);
    let result = Promise.resolve(renderSync(str));
  
    return result.value().css.replace(/\n/g, "");;
}